import React from 'react';
import Tilt from 'react-tilt';
import brain from './brain.png'
import './Logo.css'

const Logo = () => {
    return (
        <div>
            <Tilt className="br2 shadow-2 logo ma2" options={{ max : 25 }} style={{ height: 150, width: 150 }}  >
                <div className="Tilt-inner" ><img alt="brain" src={brain}/></div>
            </Tilt>
        </div>
        
    );
}

export default Logo
